import React from 'react';
import Header from './Header'; // Assuming you already have this
import MainSection from './MainSection'; // This is the section with background
import AfterMain from './AfterMain'; // This is the new section

function App() {
  return (
    <div className="App">
      <Header />
      <MainSection />  {/* The section with the background image */}
      <AfterMain />    {/* The new section with the icons and filters */}
    </div>
  );
}

export default App;
